import './MotorCycles.css';
import { Navbar, Container, Nav, NavDropdown, Form, FormControl, Button, Row, Col } from 'react-bootstrap';
import { Link } from 'react-router-dom';

import Bike from '../../Assets/images/about/bike.png';
import Bike2 from '../../Assets/images/about/bike2.png';


const MotorCycles = props => {
    return (

        <>


            <section className="motorcycle">
                <Container>
                    <div className="title">
                        <span><svg width="18" height="19" viewBox="0 0 18 19" fill="none" xmlns="http://www.w3.org/2000/svg">
                            <path d="M9.00004 18.5C7.75749 11.75 6.74995 10.7425 0 9.5C6.74995 8.25737 7.75749 7.24991 9.00004 0.5C10.2426 7.24991 11.2501 8.25745 18 9.5C11.25 10.7425 10.2427 11.75 9.00004 18.5Z" fill="#AC05EA" />
                        </svg>

                            Get ready for the change.
                            <svg width="18" height="19" viewBox="0 0 18 19" fill="none" xmlns="http://www.w3.org/2000/svg">
                                <path d="M9.00004 18.5C7.75749 11.75 6.74995 10.7425 0 9.5C6.74995 8.25737 7.75749 7.24991 9.00004 0.5C10.2426 7.24991 11.2501 8.25745 18 9.5C11.25 10.7425 10.2427 11.75 9.00004 18.5Z" fill="#AC05EA" />
                            </svg>

                        </span>
                        <h3>Cotton Designs Page coming soon. Please check back to know more. Shoot us an email if you are curious.
                        </h3>

                        <div className="entermail">
                            <input type="email" placeholder="Please enter your email" />
                            <Link to="" className="btnblue">Notify Me</Link>
                        </div>
                    </div>

                </Container>
            </section>

        </>

    )
}

export default MotorCycles;
